svg.script:
  function init(evt)
  {
    if ( window.svgDocument == null )
    {
      svgDocument = evt.target.ownerDocument;
    }
	text_info = svgDocument.getElementById('text_info');
	text_info_bg = svgDocument.getElementById('text_info_bg');
  }

  function ShowTextInfo(evt, mouseOverText)
  {
    text_info.setAttributeNS(null,"x",evt.clientX+11);
    text_info.setAttributeNS(null,"y",evt.clientY+27);
	text_info.firstChild.data = mouseOverText;
    text_info.setAttributeNS(null,"visibility","visible");

	text_info_bg.setAttributeNS(null,"x",evt.clientX+8);
    text_info_bg.setAttributeNS(null,"y",evt.clientY+14);
    text_info_bg.setAttributeNS(null,"visibility","visible");
	length = text_info.getComputedTextLength();
    text_info_bg.setAttributeNS(null,"width",length+8);
  }

  function HideTextInfo()
  {
    text_info.setAttributeNS(null,"visibility","hidden");
	text_info_bg.setAttributeNS(null,"visibility","hidden");
  }
